import { createApp } from 'vue'
import App from './App.vue'

createApp(Carousel).mount('#app')
new Vue({
    el: '#app',
    components: { App },
    template: '<App/>'
  })
import {Carousel} from './element-ui.js'
Vue.use(Carousel);
